import React, { useState } from 'react';
import Sidebar from '../components/CustSidebar';
import './ContactUs.css';

const ContactUs: React.FC = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    subject: '',
    message: ''
  });

  const contactDetails = [
    {
      icon: 'ðŸ“',
      title: 'Address',
      content: '123 Auto Drive, Mechanic Valley, CA 94025'
    },
    {
      icon: 'ðŸ“ž',
      title: 'Phone',
      content: '(555) 123-4567'
    },
    {
      icon: 'âœ‰ï¸',
      title: 'Email',
      content: 'support@bootcampauto.com'
    },
    {
      icon: 'ðŸ•’',
      title: 'Hours',
      content: 'Mon-Fri: 8am-6pm\nSat: 9am-4pm\nSun: Closed'
    }
  ];

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    setFormData({ name: '', email: '', phone: '', subject: '', message: '' });
    alert('Message sent successfully!');
  };

  return (
    <div className="app-container">
      <Sidebar />
      <div className="main-content">
        <h1>Contact Us</h1>
        <p className="page-description">Have questions or need assistance? Reach out to our team.</p>

        <div className="contact-container">
          {/* Form Card */}
          <div className="form-container">
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label>Full Name</label>
                <input
                  type="text"
                  value={formData.name}
                  onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                  required
                />
              </div>

              <div className="form-group">
                <label>Email Address</label>
                <input
                  type="email"
                  value={formData.email}
                  onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                  required
                />
              </div>

              <div className="form-group">
                <label>Phone Number</label>
                <input
                  type="tel"
                  value={formData.phone}
                  onChange={(e) => setFormData({ ...formData, phone: e.target.value })}
                />
              </div>

              <div className="form-group">
                <label>Subject</label>
                <input
                  type="text"
                  value={formData.subject}
                  onChange={(e) => setFormData({ ...formData, subject: e.target.value })}
                  required
                />
              </div>

              <div className="form-group">
                <label>Message</label>
                <textarea
                  value={formData.message}
                  onChange={(e) => setFormData({ ...formData, message: e.target.value })}
                  rows={4}
                  required
                />
              </div>

              <button type="submit" className="submit-button">
                Send Message
              </button>
            </form>
          </div>

          {/* Info Card */}
          <div className="contact-info">
            <h2>Our Information</h2>
            {contactDetails.map((item) => (
              <div key={item.title} className="info-item">
                <span className="info-icon">{item.icon}</span>
                <div className="info-content">
                  <strong>{item.title}</strong>
                  <p>{item.content}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
